## Create a Tooltip in NextJS using React Context

### Step 1: Create a Tooltip Context

Create a TooltipContext.js file in the components folder and add the following code.
```
import { createContext } from "react";

const TooltipContext = createContext();

export default TooltipContext;
```
### Step 2: Create a TooltipProvider

Create a TooltipProvider.js file in the components folder and add the following code.
```
import { useState } from "react";
import TooltipContext from "./TooltipContext";

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const value = {
    tooltip,
    setTooltip,
  };

  return (
    <TooltipContext.Provider value={value}>
      {children}
    </TooltipContext.Provider>
  );
};

export default TooltipProvider;
```
### Step 3: Create a Tooltip component

Create a Tooltip.js file in the components folder and add the following code.
```
import { useContext } from "react";
import TooltipContext from "./TooltipContext";

const Tooltip = ({ children, tooltipText }) => {
  const { tooltip, setTooltip } = useContext(TooltipContext);

  return (
    <div className="relative">
      {children}
      {tooltip === tooltipText && (
        <div className="absolute top-0 left-0 z-10 w-48 bg-white rounded-md shadow-md">
          <p className="p-4">{tooltipText}</p>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
### Step 4: Create a Tooltip component

Create a Tooltip.js file in the components folder and add the following code.
```
import { useState } from "react";
import TooltipProvider from "./TooltipProvider";
import Tooltip from "./Tooltip";

const TooltipExample = () => {
  const [tooltipText, setTooltipText] = useState(null);

  return (
    <TooltipProvider>
      <Tooltip tooltipText={tooltipText} />
      <button
        onClick={() => setTooltipText("This is a tooltip")}
        className="bg-blue-500 text-white px-4 py-2 rounded-md"
      >
        Click me
      </button>
    </TooltipProvider>
  );
};

export default TooltipExample;
```
